import React, { useRef, forwardRef, useImperativeHandle } from 'react';
import { WarningOutlined } from '@ant-design/icons';
import EasyForm from '@appen-china/easy-form';
import store from '../../store/RootStore';
import i18n from '../../locales';
import { setInitialValues, updateAttributesByFieldsCompare } from '../../utils';

export interface TargetAttributesHandle {
  getButtons: () => NodeList;
}

interface TargetAttributesProps {
  category: string;
  categoryItem: string;
  instanceId: string;
  checkFinished: (args: { type: string; values: any }) => void;
}

const TargetAttributes = forwardRef<TargetAttributesHandle, TargetAttributesProps>(({
  category,
  categoryItem,
  instanceId,
  checkFinished,
}, ref: any) => {
  const dom = useRef<HTMLDivElement>(null);
  const instanceConfig = store.ontology.getLabelConfigFromCategory(category);
  const instanceConfigDynamic = store.ontology.getDynamicLabelConfigFromCategory(category);
  const itemConfig = store.ontology.getLabelConfigFromCategoryItem(category, categoryItem);

  useImperativeHandle(ref, () => ({
    getButtons: () => dom.current?.querySelectorAll('button.easyform-btn.form-btn-submit'),
  }));

  if (!instanceConfig && !instanceConfigDynamic && !itemConfig) {
    return null;
  }
  let instanceInitialValues: {[key: string]: any} = {};
  let instanceDynamicAttributes: {[key: string]: any} = {};
  let instanceItemInitialValues: {[key: string]: any} = {};
  const selectedInstanceItem = store.instance.selectedInstanceItems[0];
  if (selectedInstanceItem) {
    const { instance, categoryItemRef, cameras } = selectedInstanceItem;
    const { currentCamera, currentFrame } = store.frame;
    if (instanceId !== 'new') {
      const destinationInstance = store.instance.getInstanceById(instanceId);
      instanceInitialValues = destinationInstance?.attributes;
    }
    instanceInitialValues = updateAttributesByFieldsCompare(instance?.categoryRef?.labelConfig?.fields || [], instanceConfig?.fields || [], instance.attributes, instanceInitialValues);
    instanceDynamicAttributes = updateAttributesByFieldsCompare(instance?.categoryRef?.labelConfigDynamic?.fields || [], instanceConfigDynamic?.fields || [], instance.dynamicAttributes?.[currentCamera]?.[currentFrame]?.attributes, instanceDynamicAttributes);
    instanceItemInitialValues = updateAttributesByFieldsCompare(categoryItemRef?.labelConfig?.fields || [], itemConfig?.fields || [], cameras[currentCamera]?.frames[currentFrame]?.attributes, {});
  }
  return (
    <div ref={dom} className="target-attributes">
      <div className="warning">
        <WarningOutlined />
        {i18n.translate('MOVE_ATTRIBUTES_CONFLICT')}
      </div>
      {instanceConfig && (
        <div className="attributes-container">
          {category && (
            <div className="attributes-container__title">
              {i18n.translate('ATTRIBUTES_MODE_INSPECT_LABEL_STATIC', { values: { prefix: category } })}
            </div>
          )}
          <EasyForm
            theme="dark"
            fields={setInitialValues(instanceConfig.fields, instanceInitialValues)}
            conditions={instanceConfig.conditions}
            effects={instanceConfig.effects}
            rules={instanceConfig.rules}
            onSubmit={(values) => checkFinished({ type: 'instance', values })}
          />
        </div>
      )}
      {instanceConfigDynamic && (
        <div className="attributes-container">
          {category && (
            <div className="attributes-container__title">
              {i18n.translate('ATTRIBUTES_MODE_INSPECT_LABEL_DYNAMIC', { values: { prefix: category } })}
            </div>
          )}
          <EasyForm
            theme="dark"
            fields={setInitialValues(instanceConfigDynamic.fields, instanceDynamicAttributes)}
            conditions={instanceConfigDynamic.conditions}
            effects={instanceConfigDynamic.effects}
            rules={instanceConfigDynamic.rules}
            onSubmit={(values) => checkFinished({ type: 'dynamicInstance', values })}
          />
        </div>
      )}
      {itemConfig && (
        <div className="attributes-container">
          <div className="attributes-container__title">{categoryItem}</div>
          <EasyForm
            theme="dark"
            fields={setInitialValues(itemConfig.fields, instanceItemInitialValues)}
            conditions={itemConfig.conditions}
            effects={itemConfig.effects}
            rules={itemConfig.rules}
            onSubmit={(values) => checkFinished({ type: 'instance-item', values })}
          />
        </div>
      )}
    </div>
  );
});

export default TargetAttributes;
